scroll_up MACRO x, y, xf, yf
LOCAL a1

									  mov                   bh,0
	                                  mov                   cl,x
	                                  mov                   ch,y

	a1:                               mov                   dl,cl
	                                  mov                   dh,ch
	                                  int                   10h

	                                  mov                   ah,8
	                                  int                   10h
	                                  mov                   bl,al

	                                  mov                   ah,2
	                                  mov                   dl,' '
	                                  int                   21h

	                                  mov                   dl,cl
	                                  mov                   dh,ch
	                                  dec                   dh
	                                  int                   10h

	                                  mov                   dl,bl
	                                  int                   21h

	                                  inc                   cl
	                                  cmp                   cl,xf
	                                  jbe                   a1

	                                  mov                   cl,x
	                                  inc                   ch
	                                  cmp                   ch,yf
	                                  jbe                   a1

ENDM scroll_up


