main_screen MACRO username_buffer, username, actual_size, name_message, enter_key, error_message,  player_color
LOCAL reEnter, NoError, v1, v2,v3, v4, n1, n2, n3, n4, validated, colored

	;-------------------------------- clear screen
									  mov si,0            ;When the user enters an invalid username the SI register holds -1 otherwise 0
	reEnter:                          clear_screen


	;-------------------------------  move cursor to (36,4) and print '[PLAYER #]' with the player's color char by char
	
	                                  mov   bh,0                     ;page 0
									  mov   dh,4                           
									  mov   cx,1                     ;print the char one time
									  mov   bl,player_color          ;player color
	                                  mov   dl,36
									  mov   di,0                     ;to indicate the index of the char to be printed

	

	;-------------------------------- move cursor to (29,10)
	                                  mov   ah,2
	                                  mov   bh,0
	                                  mov   dl,29
	                                  mov   dh,10
	                                  int   10h

	;-------------------------------- print 'Please Enter Your Name:'
	                                  mov   dx,offset name_message
	                                  mov   ah,9
	                                  int   21h

	;-------------------------------- move cursor to(29,14)
	                                  mov   ah,2
	                                  mov   dl,29
	                                  mov   dh,14
	                                  int   10h

	;-------------------------------- print 'Press Enter key to continue'
	                                  mov   dx,offset enter_key
	                                  mov   ah,9
	                                  int   21h

	;-------------------------------- print error message because of incorrect name (if any)
	                                  cmp   si,-1          ;check if the username was incorrect
	                                  jnz   NoError

	;-------------------------------- There is an error, move cursor to (0,24) 'The last line of the screen'
	                                  mov   bh,0
	                                  mov   ah,2
	                                  mov   dl,0
	                                  mov   dh,24
	                                  int   10h

    ;-------------------------------- print error message
	                                  mov   dx,offset error_message
	                                  mov   ah,9
	                                  int   21h

	;-------------------------------- read username

	;-------------------------------- move cursor to (33,12)
	NoError:                          mov   ah,2
	                                  mov   dl,33
	                                  mov   dh,12
	                                  int   10h

    ;-------------------------------- call the interrupt of reading a string from user
	                                  mov   ah,0ah
	                                  mov   dx,offset username_buffer
	                                  int   21h

	;-------------------------------- validate name
	                                  cmp   username, 'a'
	                                  jae   v1
	                                  mov   bl,0                 ;this indicates that the first char is less than 'a'
	                                  jmp   n1
	v1:                               mov   bl,1                 ;this indicates that the first char is greater than or equal to 'a'

	n1:                               cmp   username,'z'
	                                  jbe   v2
	                                  mov   bh,0                ;this indicates that the first char is greater than 'z'
	                                  jmp   n2
	v2:                               mov   bh,1                ;this indicates that the first char is less than or equal to 'z'

	n2:                               and   bh,bl

	                                  cmp   username, 'A'
	                                  jae   v3
	                                  mov   cl,0
	                                  jmp   n3
	v3:                               mov   cl,1

	n3:                               cmp   username,'Z'
	                                  jbe   v4
	                                  mov   ch,0
	                                  jmp   n4
	v4:                               mov   ch,1

	n4:                               and   ch,cl

	                                  or    bh,ch            ;check if the first char is a capital or a small letter
	                                  jnz   validated

	;-------------------------------- indicate that the name is incorrect
	                                  mov   si,-1                                                    
	                                  jmp   reEnter         ;let the user enter a new username


	;-------------------------------- put $ at the end of the name to print it later
	validated:                        mov   bl,actual_size
	                                  mov   bh,0
	                                  mov   username[bx], '$'
ENDM  main_screen


