.CODE
MAIN PROC FAR

						
	                                  mov                   ax, @data
	                                  mov                   DS, ax

	                                  call                  IntializeUARTConfigurations

	;-------------------------------- main screen for the two players

	                                  main_screen           username1_buffer, username1, actual_size1, name_message, enter_key, error_message, 7

	                                  mov                   di , offset username1
	                                  mov                   si, offset username2
	;------------------------------- putting the size of my name in cl
	                                  mov                   cl ,actual_size1

	;------------------------------- now we want to communicate with each other to send then recieve or name
	; ------------------------------ send actual size
	                                  mov                   al , cl
	                                  call                  SendAlUsingUART
	
	
	;------------------------------- recieve actual size of my friend name

	                                  call                  RecieveAlUsingUART
	                                  mov                   ch , al
	
									 
	                                  mov                   actual_size2 , ch
									 
	;-------------------------------  now cl , has my name size and ch has my friend name size
	;-------------------------------  send and recieve names of two players
	                                  call                  SEND_RECIEVE_PLAYERS_NAME
									  
									   


	;-------------------------------- program functionalities screen
                
	functionalites:                   clear_screen
	                                  call                  program_functionalities
	                                  mov                   IsMainUser,0

	;-------------------------------- wait for a key in the functionalities screen
	key_specify_action:               
	                                  call                  CheckRecievedInvitation
	                                  cmp                   al,1
	                                  jne                   NoChatInvitation
	                                  call                  chatting_module
	NoChatInvitation:                 
	                                  cmp                   al,2
	                                  je                    play_game
	
	                                  mov                   ah,1
	                                  int                   16h
	                                  jz                    key_specify_action                                                                  	;check if a key is pressed
		   

	                                  mov                   ah,0
	                                  int                   16h                                                                                 	;get the key

	                                  cmp                   ah,1
	                                  jz                    end_                                                                                	;if the key is ESC

	                                  cmp                   ah,3ch
	                                  jnz                   SkipGame
	testcase:                         mov                   al,2
	                                  call                  SendingInvitation                                                                   	;invite player to a game sending al =2
	                                  cmp                   al,2
	                                  jz                    play_game                                                                           	;if the key is F2
	SkipGame:                         
								
	; ; then one of player press f2 he should receive and if the other player didn't press  f2 then
	; ; he should set main player 1 and send to player 2 that he pressed f2
	                                  
	; check_chat_key:
	                                  cmp                   ah,3bh
	                                  jnz                   SkipChat                                                                            	;if the key is F1 (for chatting)
	                                  mov                   al,1
	                                  call                  SendingInvitation
	                                  cmp                   al,1
	                                  jnz                   SkipChat
	                                  call                  chatting_module

	SkipChat:                         
	                                  jmp                   key_specify_action

	end_:                             jmp                   end_program                                                                         	;this is because the program can't jump directly



	play_game:                        mov                   ax, 4F02h
	                                  mov                   bx, 0100h                                                                           	; 640x400 screen graphics mode
	                                  int                   10h                                                                                 	;execute the configuration
	
	;-------------------------------- to print the game's logo
	                                  mov                   ax,EXTRA_DATA1
	                                  mov                   DS,ax
	                                  assume                DS:EXTRA_DATA1
	                                  call                  DRAW_START_LOGO

	                                  mov                   ax,EXTRA_DATA2
	                                  mov                   DS,ax
	                                  assume                DS:EXTRA_DATA2
	                                  call                  DRAW_SOCCER
									  
	;-------------------------------- use the normal data segment
	                                  mov                   ax,@data
	                                  mov                   ds,ax
	                                  assume                DS:@DATA

	;-------------------------------- print 'PRESS 1 FOR LEVEL 1 OR PRESS 2 FOR LEVEL 2'
	                                  cmp                   IsMainUser ,1
	                                  jnz                   recieve_level
	                                  move_cursor           12h, 18h
	                                  mov                   dx,offset LEVEL_MESSAGE
	                                  mov                   ah,9
	                                  int                   21h
                              

	wait_key:                         mov                   ah,1
	                                  int                   16h
	                                  jz                    wait_key

	                                  mov                   ah,0
	                                  int                   16h
									  
	                                  CMP                   AL ,'1'
	                                  JE                    SET_LEVEL1
	                                  CMP                   AL , '2'
	                                  JE                    SET_LEVEL2
	                                  jmp                   wait_key

	recieve_level:                    
	                                  call                  RecieveAlUsingUART
	                                  cmp                   al ,1
	                                  jz                    Recieve_level1
	                                  cmp                   al ,2
	                                  jz                    Recieve_level2

	Recieve_level1:                   
	                                  mov                   LEVEL_STATUS ,al

	                                  move_cursor           26 ,23
	                                  mov                   ah ,9
	                                  mov                   dx , offset Level1_message
	                                  int                   21h

	                                  move_cursor           27 ,24
	                                  mov                   ah ,9
	                                  mov                   dx , offset load_screen_str
	                                  int                   21h
									  
	                                  jmp                   AFTER_KEY
	                                  

	Recieve_level2:                   mov                   LEVEL_STATUS,al
	 
	                                  move_cursor           26 ,23
	                                  mov                   ah ,9
	                                  mov                   dx , offset Level2_message
	                                  int                   21h

	                                  move_cursor           27 ,24
	                                  mov                   ah ,9
	                                  mov                   dx , offset load_screen_str
	                                  int                   21h

	                                  jmp                   AFTER_KEY
									  
									  
									                   
	SET_LEVEL1:                       
	                                  MOV                   LEVEL_STATUS ,1
	                                  mov                   al ,LEVEL_STATUS
	                                  call                  SendAlUsingUART
	                                  JMP                   AFTER_KEY
	SET_LEVEL2:                       
	                                  MOV                   LEVEL_STATUS,2
	                                  mov                   al ,LEVEL_STATUS
	                                  call                  SendAlUsingUART


	AFTER_KEY:                        
	;-------------------------------- get the key because if the user pressed on F4, the game will not exit
	                                  mov                   ah,0
	                                  int                   16h
	;---------------------------------------------SET_LEVEL_VALUES-----------------------------------------------------------------------------------------------------------------------------------------------
	                                  CMP                   LEVEL_STATUS ,1                                                                     	;CHECK IF WE ARE IN LEVEL 1
	                                  JE                    LEVEL_1
	                                  CMP                   LEVEL_STATUS,2
	                                  JE                    LEVEL_2
									  

	LEVEL_1:                          
	                                  MOV                   BX       ,Player1W_level1
	                                  MOV                   PLAYER1W , BX
	                                  MOV                   BX       ,Player1H_level1
	                                  MOV                   PLAYER1H , BX
	                                  MOV                   BX ,Player1X_level1
	                                  MOV                   Player1X , BX
	                                  MOV                   BX ,Player1Y_level1
	                                  MOV                   PLAYER1Y , BX

	                                  MOV                   BX ,Player2W_level1
	                                  MOV                   PLAYER2W , BX
	                                  MOV                   BX ,Player2H_level1
	                                  MOV                   PLAYER2H , BX
	                                  MOV                   BX ,Player2X_level1
	                                  MOV                   Player2X , BX
	                                  MOV                   BX ,Player2Y_level1
	                                  MOV                   PLAYER2Y , BX
									  
	                                  MOV                   BX ,GravityLine_level1
	                                  MOV                   GravityLine,BX
	                                  MOV                   BX ,LandLine_level1
	                                  MOV                   LandLine , BX

	                                  MOV                   BL , MAX_GOAL_IN_level1
	                                  MOV                   MAX_GOAL_IN_level,BL

	                                  JMP                   GAME_
	                            
	LEVEL_2:                          
	                                  MOV                   BX ,Player1W_level2
	                                  MOV                   PLAYER1W , BX
	                                  MOV                   BX ,Player1H_level2
	                                  MOV                   PLAYER1H , BX
	                                  MOV                   BX ,Player1X_level2
	                                  MOV                   Player1X , BX
	                                  MOV                   BX ,Player1Y_level2
	                                  MOV                   PLAYER1Y , BX
									  
	                                  MOV                   BX ,Player2W_level2
	                                  MOV                   PLAYER2W , BX
	                                  MOV                   BX ,Player2H_level2
	                                  MOV                   PLAYER2H , BX
	                                  MOV                   BX ,Player2X_level2
	                                  MOV                   Player2X , BX
	                                  MOV                   BX ,Player2Y_level2
	                                  MOV                   PLAYER2Y , BX

	                                  MOV                   BX ,GravityLine_level2
	                                  MOV                   GravityLine,BX
	                                  MOV                   BX ,LandLine_level2
	                                  MOV                   LandLine , BX

	                                  MOV                   BL , MAX_GOAL_IN_level2
	                                  MOV                   MAX_GOAL_IN_level,BL
	;-------------------------------- change mode to graphics mode to clear the screen
	GAME_:                            mov                   ax, 4F02h
	                                  mov                   bx, 0100h                                                                           	; 640x400 screen graphics mode
	                                  int                   10h
									  

	                                  call                  score_bar
	                                  call                  SwapTheTwoNamesIfNotMainUser
	                                  call                  print_game_strings
	                                  call                  print_player1_score
	                                  call                  print_player2_score
	                                  

	                                  call                  BackGround
	                                  call                  DrawingBall
	                                  call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  delay
	                                 
	;-------------------------------- GAME MAIN LOOP (INFINITE LOOP UNTILL THE PLAYER PRESS F4)
	GameProcess:                      

	;-------------------------------- check if the user pressed on F4 which is first bit in GameStatus2
	                                  test                  GameStatus2,01b
	                                  jz                    continue_game
	                                  call                  new_game

	;-------------------------------- change the mode to text mode to go back to the functionalities screen
	                                  mov                   ah,0
	                                  mov                   al,3
	                                  int                   10h
	                                  jmp                   functionalites
	;-------------------------------------------------------------------------
	;-------------------------------- check if in game chat is chosen second bit in gamestatus2
	continue_game:                    test                  GameStatus2,10b
	                                  jz                    SoccerGame
	                                  call                  in_game_chatting
									  
	;-------------------------------- then check if key is pressed
	SoccerGame:                       call                  CheckKeyPressed
	                                  call                  MainProcessOftTheGame
	                                  jmp                   GameProcess
									  
	;important whoever apply the invitation part
	;not we still have to intialize IsMainUser according to the player who send the invitation


	end_program:                      mov                   ah,4ch
	                                  int                   21h
            
MAIN ENDP

	;this function hadles the chat inside the game
in_game_chatting proc

	;-------------------------------- print the strings of the status bar
									  clear_last_line

	                                  move_cursor           0,24
	                                  mov                   ah,9
	                                  mov                   dx,offset end_ingame_chatting_str
	                                  int                   21h

	;-------------------------------- initialize the cursor parameters of the in-game chatting
	                                  mov                   x1_ingame,1
	                                  mov                   y1_ingame,20
	                                  mov                   x2_ingame,41
	                                  mov                   y2_ingame,20

	                                  move_cursor           x1_ingame,y1_ingame

	;-------------------------------- check if a key is pressed
	main_loop_ig:                     mov                   ah,1
	                                  int                   16h
	                                  jnz                   write_send_ig

	;-------------------------------- check if there is a sent character
	                                  mov                   dx,3fdh
	                                  in                    al,dx
	                                  test                  al,1
	                                  jnz                   rec_ig

	                                  jmp                   main_loop_ig


	;-------------------------------- read the key
	write_send_ig:                    
	                                  mov                   ah,0
	                                  int                   16h

	;-------------------------------- check if the character is non printable to send its scan code
	                                  cmp                   al,0
	                                  jz                    scan_code_ig
									  
	                                  mov                   sent_char,al
	                                  jmp                   next_ig
	scan_code_ig:                     cmp                   ah,3dh
	                                  jz                    f3_key_ig
	                                  jmp                   main_loop_ig
	f3_key_ig:                        mov                   sent_char,-1



	next_ig:                          mov                   dx,3fdh
	again_ig:                         in                    al,dx
	                                  test                  al,00100000b
	                                  jz                    again_ig

	                                  mov                   dx,3f8h
	                                  mov                   al,sent_char
	                                  out                   dx,al

	                                  move_cursor           x1_ingame,y1_ingame

	                                  cmp                   sent_char,-1
	                                  jz                    f_ig

	                                  cmp                   sent_char,0dh
	                                  jz                    new_line_ig

	                                  cmp                   sent_char,08
	                                  jz                    main_loop_ig

	print_char_ig:                    get_cursor
	                                  mov                   bl,dl
	                                  mov                   dl,sent_char
	                                  mov                   ah,2
	                                  int                   21h
	                                  cmp                   bl,38
	                                  jz                    n1_ig
	                                  get_cursor
	                                  mov                   x1_ingame,dl
	                                  mov                   y1_ingame,dh
	                                  jmp                   main_loop_ig

	rec_ig:                           jmp                   write_recieve_ig
	m_loop_ig:                        jmp                   main_loop_ig
	f_ig:                             jmp                   finish_chatting
	new_line_ig:                      get_cursor



	n1_ig:                            cmp                   dh,22
	                                  jnz                   next_line_ig
								
	                                  clear_first_line      1
	                                  scroll_up             1,21,38,22
	                                  mov                   dh,21

	next_line_ig:                     mov                   ah,2
	                                  mov                   bh,0
	                                  mov                   dl,1
	                                  inc                   dh
	                                  int                   10h
	                                  get_cursor
	                                  mov                   x1_ingame,dl
	                                  mov                   y1_ingame,dh
	                                  jmp                   main_loop_ig

	finish_chatting:                  jmp                   end_chatting
	m_loop2_ig:                       jmp                   m_loop_ig


	write_recieve_ig:                 move_cursor           x2_ingame,y2_ingame
	                                  mov                   dx,3f8h
	                                  in                    al,dx

	                                  cmp                   al,-1
	                                  jz                    end_chatting

	                                  cmp                   al,0dh
	                                  jz                    new_line2_ig

	                                  cmp                   al,08
	                                  jz                    m_loop2_ig


	                                  get_cursor
	                                  mov                   bl,dl
	                                  mov                   dl,al
	                                  mov                   ah,2
	                                  int                   21h
	                                  cmp                   bl,78
	                                  jz                    n2_ig
	                                  get_cursor
	                                  mov                   x2_ingame,dl
	                                  mov                   y2_ingame,dh
	                                  jmp                   main_loop_ig
	end_chatting:                     jmp                   end_chatting1


	new_line2_ig:                     get_cursor


	n2_ig:                            cmp                   dh,22
	                                  jnz                   next_line2_ig
								
	                                  clear_first_line      41
	                                  scroll_up             41,21,79,22
	                                  mov                   dh,21

	next_line2_ig:                    mov                   ah,2
	                                  mov                   bh,0
	                                  mov                   dl,41
	                                  inc                   dh
	                                  int                   10h
	                                  get_cursor
	                                  mov                   x2_ingame,dl
	                                  mov                   y2_ingame,dh
	                                  jmp                   main_loop_ig


	end_chatting1:                    
	                                  And                   GameStatus2,01b
	                                  clear_last_line
	                                  move_cursor           0,24

	;-------------------------------- print the end game string
	                                  mov                   dx,offset end_game_str
	                                  mov                   ah,9
	                                  int                   21h
									  
	                                  mov                   dx, offset start_ingame_chatting_str
	                                  int                   21h

	                                  ret


in_game_chatting endp

	;description
	;swaps the two username 1 & 2 if the current player isn't the man user
	;in order to print then in the correct place
SwapTheTwoNamesIfNotMainUser PROC
	
	                                  cmp                   IsMainUser,1
	                                  jz                    ExitSwapTheTwoNamesIfNotMainUser
	
	                                  mov                   si,offset username1_buffer
	                                  mov                   di,offset username2_buffer

	                                  mov                   cx,18
	SwapCharacter:                    
	                                  mov                   al,[si]
	                                  mov                   bl,[di]
	                                  mov                   [si],bl
	                                  mov                   [di],al
	                                  inc                   si
	                                  inc                   di
	                                  loop                  SwapCharacter

	ExitSwapTheTwoNamesIfNotMainUser: 
	                                  ret
SwapTheTwoNamesIfNotMainUser ENDP

	;DESCRIPTION
	;NOW PLAYER PRESS F2 THEN WE CHECK WHO IS THE MAIN PLAYER THEN FIRST HE RECIEVE
	;IF THE OTHER PLAYER PRESS AND SEND FIRST THEN THE OTHER PLAYER IS THE MAIN
	;ELSE I SEND TO THE OTHER PLAYER THE KEY 'S SCAN
SEND_RECIEVE_F2 PROC
	                    
	SEND_F2:                          
	                                  mov                   dx , 3fdh
									  
	                                  in                    al ,dx
	                                  test                  al,00100000b
	                                  jz                    RECIEVE_F2
                           

	                                  mov                   dx , 3f8h
	                                  mov                   al ,3ch
	                                  out                   dx ,al
	                                  mov                   IsMainUser ,1
	

	                                  jmp                   FINSISH_F2_COM


	RECIEVE_F2:                       
	                                  mov                   dx , 3fdh
	                                  in                    al , dx
	                                  test                  al ,1
	                                  jz                    SEND_F2

	                                  mov                   dx , 03f8h
	                                  in                    al ,dx
	

	FINSISH_F2_COM:                   
	                                  ret
	                              


SEND_RECIEVE_F2 ENDP


SEND_RECIEVE_PLAYERS_NAME PROC
	send_res:                         
	                                  mov                   dx , 3fdh
									  
	                                  in                    al ,dx
	                                  test                  al,00100000b
	                                  jz                    check_finish

	                                  cmp                   cl ,0
	                                  je                    recieve

	                                  mov                   dx , 3f8h
	                                  mov                   al ,[di]
	                                  out                   dx ,al
	                                  inc                   di
	                                  dec                   cl

	recieve:                          
	                                  mov                   dx , 3fdh
	                                  in                    al , dx
	                                  test                  al ,1
	                                  jz                    check_finish

	                                  mov                   dx , 03f8h
	                                  in                    al ,dx

	                                  mov                   [si], al
	                                  inc                   si
	                                  dec                   ch

	check_finish:                     
	                                  cmp                   cl ,0
	                                  jnz                   send_res

	                                  cmp                   ch ,0
	                                  jnz                   send_res

	                                  mov                   bl,actual_size2
	                                  mov                   bh,0
	                                  mov                   username2[bx], '$'
	                                  ret




SEND_RECIEVE_PLAYERS_NAME ENDP

	;description
	;check if invitation is recieved and send respond
CheckRecievedInvitation PROC
	;check if have recieved invitation to game or chat

	;Check that data is recieved
	                                  mov                   dx,3FDH
	                                  in                    al,dX
	                                  test                  al,1
	                                  jz                    ExitCheckRecievedInvitation                                                         	;check if recieved game invitation
	;if ready put it in al

	                                  mov                   dx,3f8H
	                                  in                    al,dx
	                                  mov                   cl,al
	                                  cmp                   al,1
	                                  jz                    RecievedChatInvitation                                                              	;recieved chat invitaion
	                                  cmp                   al,2
	                                  jz                    RecievedGameInvitation                                                              	; recieved game invitaion
	                                  jmp                   ExitCheckRecievedInvitation


	RecievedChatInvitation:           
	;-------------------------------- move cursor to (0,24)
	                                  move_cursor           0,24
	;print notification with intstruction
	;-------------------------------- print
	                                  mov                   dx,offset notifi_recievedchatinvitation
	                                  mov                   ah,9
	                                  int                   21h
	                                  jmp                   WaitingToAcceptOrDecline
	RecievedGameInvitation:           
	;-------------------------------- move cursor to (0,24)
	                                  move_cursor           0,24
	;print notification with intstruction
	;-------------------------------- print
	                                  mov                   dx,offset notifi_recievedgameinvitation
	                                  mov                   ah,9
	                                  int                   21h
									  
	;get the the decision whether accept or decline the invitatoin
	WaitingToAcceptOrDecline:                                                                                                                   	;check what pressed key to send to a respond to the invitaion


	;check if the other player cancedled the invitation
	;Check that data is recieved
	                                  mov                   dx,3FDH
	                                  in                    al,dX
	                                  test                  al,1
	                                  jz                    NoCancelToInvitation
	;if ready put it in al
	                                  mov                   dx,3f8H
	                                  in                    al,dx
	                                  cmp                   al,0
	                                  jz                    ExitCheckRecievedInvitation

	NoCancelToInvitation:             
	                                  mov                   ah,1
	                                  int                   16h
	                                  jz                    WaitingToAcceptOrDecline
									  
	                                  mov                   ah,0
	                                  int                   16h
	;pressed esc to exit?
	                                  cmp                   ah,1
	                                  mov                   al,0
	                                  jz                    SendRespond
	;pressed f2 to accept game

	                                  cmp                   ah,3ch
	                                  mov                   al,2
	                                  jz                    SendRespond
	;pressed f1 to accept chat
	                                  cmp                   ah,3bh
	                                  mov                   al,1
	                                  jz                    SendRespond

	                                  jmp                   WaitingToAcceptOrDecline
	
	SendRespond:                      
	;send the respond to the invitation
	                                  call                  SendAlUsingUART                                                                     	;send respond using UART
	                                  cmp                   al,cl
	                                  jz                    ExitCheckRecievedInvitation
	                                  mov                   al,0
	ExitCheckRecievedInvitation:      
	                                  mov                   IsMainUser,0
	                                  ret
CheckRecievedInvitation ENDP

	;description
	;proc to send char or game invite using UART
SendingInvitation PROC
	;save current invitation type in cl
	                                  mov                   cl,al                                                                               	;keeping the invitation mode in bl

	;-------------------------------- move cursor to (0,24)
	                                  move_cursor           0,23
	;print notification with the instruction
	;-------------------------------- print
	                                  mov                   dx,offset notifi_sentinvitation
	                                  mov                   ah,9
	                                  int                   21h
									  
	                                  mov                   al,cl
	                                  call                  SendAlUsingUART
									  
	WaitingForAccept:                 
	;waiting for the respond to the invitation
	                                  mov                   ah,1
	                                  int                   16h
	                                  jz                    DidNotescWaiting
	;if esc pressed cancel

	                                  mov                   ah,0
	                                  int                   16h
	                                  cmp                   ah,1                                                                                	;check if esc pressed stop waiting for accept
	                                  mov                   al,0
	                                  jZ                    SendThatYouCanceledInvitation

	;Check that data is recieved4
	DidNotescWaiting:                 
	                                  mov                   dx,3FDH
	                                  in                    al,dX
	                                  test                  al,1
	                                  jz                    WaitingForAccept
	;if ready put it in al
	                                  mov                   dx,3f8H
	                                  in                    al,dx
	                                  cmp                   al,cl
	                                  jnz                   ExitSendingInvitation
									 
	;make him the main user because he sended the invitation
	                                  mov                   IsMainUser ,1
	                                  jmp                   ExitSendingInvitation
	SendThatYouCanceledInvitation:    
	                                  mov                   al,0
	                                  call                  SendAlUsingUART
	ExitSendingInvitation:            
	                                  ret
SendingInvitation ENDP


	;description
	;THIS PROCEDURE HANDLE THE GAME STATUS NIBBLE WHICH
	;INDICATES IF A PLAYER SCORED OR WON
	;a ->main player scored,b->other player scored,c ->main player won,d->other player won
ApplyGameStatus PROC
	
	                                  test                  GameStatus,0001b
	                                  JZ                    MainPlayerNoScore
	;mainplayerscored
	                                  inc                   player1_score
	                                  call                  print_player1_score
	                                  call                  GOOAL
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition

	;----------------------------------------------------------------------------------------------
	MainPlayerNoScore:                
	                                  test                  GameStatus,0010b
	                                  JZ                    SecondryPlayerNoScore
	;the other player scored
		
	                                  inc                   player2_score
	                                  call                  print_player2_score
	                                  call                  GOOAL
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition
	;----------------------------------------------------------------------------------------------

	SecondryPlayerNoScore:            

	                                  test                  GameStatus,0100b
	                                  JZ                    MainPlayerNowon
	;mainplayerwon
	                                  call                  BackGround
	                                  call                  DrawingBall
	                                  Call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  DRAW_PLAYER1_WINS
	                                  call                  delay
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition
	                                  call                  new_game
	;----------------------------------------------------------------------------------------------

	MainPlayerNowon:                  
	                                  test                  GameStatus,1000b
	                                  JZ                    SecondryPlayerNowon

	;the other player won
