	                                  call                  DrawingBall
	                                  Call                  drawGoalKeepers
	                                  call                  DRAWE_PLAYER1
	                                  call                  DRAWE_PLAYER2
	                                  call                  DRAW_PLAYER2_WINS
	                                  call                  delay
	                                  call                  FREAZE_FOR_GOAL
	                                  call                  PutElementsInIntialPosition
	                                  call                  new_game
	;----------------------------------------------------------------------------------------------
	
	SecondryPlayerNowon:              

	                                  ret
ApplyGameStatus ENDP

