	;description
	;this procedure draws the ball pixels in the ball current position
	;using ballx and bally that indicate the ball x and y point
DrawingBall PROC
	                                  mov                   dx,BallY
	                                  mov                   cx,BallX
	                                  mov                   si,offset BallColor                                                                 	;intialize the position & carry
	DrawRow:                          

	                                  mov                   al,[si]                                                                             	;mov current color
