	;description
	;THIS PROCEDURE CHECK IF THE BALL COLLIDE WITH A PLAYER
	;AND INCREASE THE SPEED OF THE BALL IF IT HIT THE PLAYER
CheckBallCollisionWithPlayers PROC
	;first check the x axis maxx1>minx2 && maxx2>minx1
	                                  mov                   Ax,BallX
	                                  add                   Ax,BallW
	                                  mov                   Bx ,Player1X
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer1

	                                  mov                   Ax,Player1X
	                                  add                   Ax,Player1W
	                                  mov                   Bx,BallX
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer1
									            

	;first check the y axis maxy1>miny2 && maxy2>miny1

	                                  mov                   Ax,BallY
	                                  add                   Ax,BallH
	                                  mov                   Bx ,Player1Y
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer1

	                                  mov                   Ax,Player1Y
	                                  add                   Ax,Player1H
	                                  mov                   Bx,BallY
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer1

	                                  NEG                   BallSpeedX
	;increase ballspeed in both direction due to colision
	                                  add                   BallSpeedY,10
	                                  mov                   Ax,Player1X
	                                  add                   Ax,Player1W
	                                  mov                   Bx,BallX
	                                  add                   Bx,BallW
	                                  cmp                   Ax,Bx
	                                  JL                    Player1IsOnLeft
	                                  sub                   BallSpeedX,5
	                                  jmp                   ExitCheckBallCollisionWithPlayer1
	Player1IsOnLeft:                  add                   BallSpeedX,5

	ExitCheckBallCollisionWithPlayer1:
	;first check the x axis maxx1>minx2 && maxx2>minx1
	                                  mov                   Ax,BallX
	                                  add                   Ax,BallW
	                                  mov                   Bx ,Player2X
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer2

	                                  mov                   Ax,Player2X
	                                  add                   Ax,Player2W
	                                  mov                   Bx,BallX
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer2

	;first check the y axis maxy1>miny2 && maxy2>miny1

	                                  mov                   Ax,BallY
	                                  add                   Ax,BallH
	                                  mov                   Bx ,Player2Y
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer2

	                                  mov                   Ax,Player2Y
	                                  add                   Ax,Player2H
	                                  mov                   Bx,BallY
	                                  cmp                   Ax,Bx
	                                  JNG                   ExitCheckBallCollisionWithPlayer2

	                                  NEG                   BallSpeedX
	;increase ballspeed in both direction due to colision
	                                  add                   BallSpeedY,10
	                                  mov                   Ax,Player2X
	                                  add                   Ax,Player2W
	                                  mov                   Bx,BallX
	                                  add                   Bx,BallW
	                                  cmp                   Ax,Bx
	                                  JL                    Player2IsOnLeft
	                                  sub                   BallSpeedX,5
