chatting_module proc
	                                  clear_screen

	                                  move_cursor           0,24                                                                                	;last line of the screen
	                                  mov                   ah,9

	;-------------------------------- print the messages of the status bar
	                                  mov                   dx,offset end_chatting_message1
	                                  int                   21h

	                                  mov                   dx,offset username2
	                                  int                   21h

	                                  mov                   dx,offset end_chatting_message2
	                                  int                   21h

	;-------------------------------- initialize the parameters of the screen
	                                  mov                   x1,5
	                                  mov                   x2,5
	                                  mov                   y1,1
	                                  mov                   y2,13

	;-------------------------------- print the name of the current user
	                                  move_cursor           0 ,0
	                                  mov                   ah,9
	                                  mov                   dx , offset username1
	                                  int                   21h

	                                  mov                   ah ,2
	                                  mov                   dl ,':'
	                                  int                   21h

	;-------------------------------- print the name of the other user
	                                  move_cursor           0,12
	                                  mov                   ah ,9
	                                  mov                   dx , offset username2
	                                  int                   21h

	                                  mov                   ah ,2
	                                  mov                   dl ,':'
	                                  int                   21h

	;-------------------------------- status dashes
	                                  print_dashes          23
	                                  print_dashes          11

	                                  move_cursor           x1,y1


	;-------------------------------- check if a key is pressed
	main_loop:                        mov                   ah,1
	                                  int                   16h
	                                  jnz                   write_send

	;-------------------------------- check if there is a sent character
	                                  mov                   dx,3fdh
	                                  in                    al,dx
	                                  test                  al,1
	                                  jnz                   rec
									  
	                                  jmp                   main_loop


	;-------------------------------- get the pressed key
	write_send:                       
	                                  mov                   ah,0
	                                  int                   16h

	;-------------------------------- check if the character is non printable to send its scan code
	                                  cmp                   al,0
	                                  jz                    scan_code
	                                  mov                   sent_char,al
	                                  jmp                   nextt

	;-------------------------------- check if the key is F3 (the key which ends the chat)
	scan_code:                        cmp                   ah,3dh
	                                  jz                    f3_key

	;-------------------------------- if the key is non printable and is not F3 then return back and don't send anything
	                                  jmp                   main_loop
	f3_key:                           mov                   sent_char,-1

	;-------------------------------- check if the holding register is empty to send the character
	nextt:                            mov                   dx,3fdh
	ag:                               in                    al,dx
	                                  test                  al,00100000b
	                                  jz                    ag

	;-------------------------------- send the character
	                                  mov                   dx,3f8h
	                                  mov                   al,sent_char
	                                  out                   dx,al


	                                  move_cursor           x1,y1
	;-------------------------------- the key was F3 then exit
	                                  cmp                   sent_char,-1
	                                  jz                    finish_program

	;-------------------------------- the key is enter
	                                  cmp                   sent_char,0dh
	                                  jz                    new_line

	;-------------------------------- the key is backspace then return to the loop
	                                  cmp                   sent_char,08
	                                  jz                    main_loop

	print_char:                       get_cursor

	                                  mov                   bl,dl                                                                               	;save the x-value of the cursor
	                                  mov                   dl,sent_char
	                                  mov                   ah,2
	                                  int                   21h                                                                                 	;print the char
	                                  cmp                   bl,79                                                                               	;check if the x-value is the last column
	                                  jz                    n1
	                                  get_cursor
	                                  mov                   x1,dl
	                                  mov                   y1,dh                                                                               	;save the cursor values
	                                  jmp                   main_loop

	;-------------------------------- far jump
	rec:                              jmp                   write_recieve
	m_loop:                           jmp                   main_loop

	new_line:                         get_cursor

	n1:                               cmp                   dh,10                                                                               	;check if it the last row
	                                  jnz                   next_line
									  
	;-------------------------------- scroll up one line
	                                  mov                   ah,6
	                                  mov                   al,1
	                                  mov                   bh,7
	                                  mov                   cl,5
	                                  mov                   ch,1
	                                  mov                   dl,79
	                                  mov                   dh,10
	                                  int                   10h
	                                  mov                   dh,9

	;-------------------------------- move cursor to the last line
	next_line:                        mov                   ah,2
	                                  mov                   bh,0
	                                  mov                   dl,5
	                                  inc                   dh
	                                  int                   10h
	                                  get_cursor
	                                  mov                   x1,dl                                                                               	;save the cursor values
	                                  mov                   y1,dh
	                                  jmp                   main_loop

	finish_program:                   jmp                   en

	;-------------------------------- get the recieved character
	write_recieve:                    move_cursor           x2,y2
	                                  mov                   dx,3f8h
	                                  in                    al,dx

	;-------------------------------- the recieved key is F3 then exit
	                                  cmp                   al,-1
	                                  jz                    en

	                                  cmp                   al,0dh
	                                  jz                    new_line2

	                                  cmp                   al,08
	                                  jz                    m_loop


	                                  get_cursor
	                                  mov                   bl,dl
	                                  mov                   dl,al
	                                  mov                   ah,2
	                                  int                   21h
	                                  cmp                   bl,79
	                                  jz                    n2
	                                  get_cursor
	                                  mov                   x2,dl
	                                  mov                   y2,dh
	                                  jmp                   main_loop

	new_line2:                        get_cursor


	n2:                               cmp                   dh,22
	                                  jnz                   next_line2

	;-------------------------------- scroll up one line
	                                  mov                   ah,6
	                                  mov                   al,1
	                                  mov                   bh,7
	                                  mov                   cl,5
	                                  mov                   ch,13
	                                  mov                   dl,79
	                                  mov                   dh,22
	                                  int                   10h
	                                  mov                   dh,21

	next_line2:                       mov                   ah,2
	                                  mov                   bh,0
	                                  mov                   dl,5
	                                  inc                   dh
	                                  int                   10h
	                                  get_cursor
	                                  mov                   x2,dl                                                                               	;save the cursor values
	                                  mov                   y2,dh
	                                  jmp                   main_loop

	en:                               clear_screen
	                                  call                  program_functionalities                                                             	;main screen
	                                  ret

chatting_module endp


